import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
import CollectionPreview from "../../components/collection-preview/collectoin-preview.component"
import { selectCollections } from "../../redux/gallery/gallery.selectors.js";

import GALLERY_DATA from "../../redux/gallery/gallery.data.js";

const GalleryPage = ({ collections }) (
  <div className="gallery-page">
  {
    collections.map(({ id, ...otherCollectionProps }) => (
      <CollectionPreview key={id} {...otherCollectionProps} />
    ))
  }
  </div>  
);

const mapStateToProps = createStructuredSelector({
  collections: selectCollections,
})

export default connect(mapStateToProps)(GalleryPage);
